var Jsoniq = {};
Jsoniq.load = function() {

    ace.define('ace/snippets/jsoniq', ['require', 'exports', 'module' ], function(require, exports, module) {


        exports.snippetText = "";
        exports.scope = "jsoniq";

        });

};

